import React, { Component } from "react"
import axios from 'axios'

class Home extends Component{
  
    constructor(props)
    {
        super(props)
        this.state = {
            articles: []
        }
    }

    componentDidMount(){

        axios.get('https://news-app-api.k8s.devebs.net/articles')
        .then(response => {
            console.log(response.data.articles)
            this.setState({articles: response.data.articles})
        })
        .catch(error =>{
            console.log(error)
        })
    }

    render() {
        const { articles } = this.state
        return (
              <div className="homepage">
                <LocationBar />
                <Input
                  type="text"
                  placeholder="Search for news"
                  icon={search}
                  iconType="button"
                  mt="16"
                  mb="16"
                />
                <Swiper className="events-slider" modules={[FreeMode]}>
                  {!!articles &&
                    articles.length > 0 &&
                    articles.map((item, index) => {
                      const {
                       author,
                       content,
                       description,
                       source,
                       title,
                       urlToImage,
                      } = item;
                      return (
                        <SwiperSlide key={index}>
                          <EventCardLG
                            title={title}
                            urlToImage={urlToImage}
                          />
                        </SwiperSlide>
                      );
                    })}
                </Swiper>
                {/* <div className="upcoming-events">
                  <div className="upcoming-events__title">
                    <h5>News</h5>
                    <a href="/upcoming-events">See all</a>
                  </div>
                  {!!events &&
                    events.length > 0 &&
                    events.map((item) => {
                      const {
                        eventID,
                        eventName,
                        eventDate,
                        eventLocation,
                        eventImage,
                        eventDescription,
                        peopleJoined,
                        eventTime,
                      } = item;
                      return (
                        <EventCardSM
                          key={eventID * 2}
                          eventImage={eventImage}
                          eventDate={eventDate}
                          eventTime={eventTime}
                          eventTitle={eventName}
                          eventDescription={eventDescription}
                          eventLocation={eventLocation}
                          peopleJoined={peopleJoined}
                        />
                      );
                    })}
                </div> */}
              </div>
            );
    }
}

export default Home
